import React from 'react';
import EventCard from './EventCard';
import './EventList.css';

const EventList = ({ events, onRegister }) => {
  return (
    <div className="events-list">
      {events.map(event => (
        <EventCard
          key={event.id}
          event={event}
          onRegister={onRegister}
        />
      ))}
    </div>
  );
};

export default EventList;
